import * as React from "react";

const CheckRoundedIcon = () => {
  return (
    <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 50 50">
      <circle cx="25.12" cy="24.98" r="25" fill="#71bc51"/>
      <polygon points="20.99 34.63 12.72 26.59 16.03 23.38 20.99 28.2 34.21 15.34 37.52 18.55 20.99 34.63" fill="#fff"/>
    </svg>
  );
};

export default CheckRoundedIcon;
